import Vue from 'vue'
import VueRouter from 'vue-router'

Vue.use(VueRouter)

const routes = [
  // { path: '/', name: 'Console', component: r => { require(['./Console.vue'], r) }, meta: { title: 'Console' }}
]

export default new VueRouter({
  routes: routes
})
